import { Login } from '../components/auth/login'
import { Signup } from '../components/auth/signup'
const routes = [
    {
        path: '/login',
        component: Login
    },
    {
        path: '/signup',
        component: Signup
    }

]

export function mapPath (path) {
  console.log(path)
    return routes.find(route => {return  route.path === path? route.component : null})
}
